export const reaction2icon = id => {
    switch (id) {
        case 1:
            return <ThumbsDown />;
        case 50:
            return <Fire />;
        case 51:
            return <Laughing />;
        case 100:
            return <Star />;
        case 10:
            return <Heart />
    }
    return <NotFound />;
}
